import React, { Component } from 'react';
import { Link } from "react-router-dom";



class Header extends Component {
   
  render(){
    return (
        <div>
           <Link to="/learn">learn</Link>
           <Link to="/contact">learn</Link>
        </div>
    )
  }
}

export default Header;
